import React from 'react'

import { Helmet } from "react-helmet-async";

export const Profile = () => {

    return (

        <>

            <Helmet>
                <title>Profile</title>

                <style type="text/css">{` 
                    main{
                    flex-direction: column;
                    }

                    .delete{
                    margin-top: 25px;
                    background-color:  #dc3545;
                    padding: 0.375rem 0.75rem;
                font-size: 1rem;
                line-height: 1.5;
                border-radius: 0.25rem;
                border-color: #dc3545;
                    }

        `}</style>
            </Helmet>

        </>

    )

}
